/**
 * 全局配置文件
 */
export default {
  title: "用户管理基础系统",
  indexTitle: '用户管理基础系统',
  logo:require("../assets/logo.png"),
  clientId: 'saber', // 客户端id
  clientSecret: 'saber_secret', // 客户端密钥
  tenantMode: true, // 是否开启租户模式
  captchaMode: true, // 是否开启验证码模式
  key: 'saber',//配置主键,目前用于存储
  lockPage: '/lock',
  tokenTime: 6000,
  tokenHeader: 'tongtech-auth',//token请求头的key
  //http的status默认放行不才用统一处理的,
  statusWhiteList: [],
  //配置首页不可关闭
  isFirstPage: false,
  fistPage: {
    label: "首页",
    value: "/wel/index",
    params: {},
    query: {},
    meta: {
      i18n: 'dashboard'
    },
    group: [],
    close: false
  },
  //配置菜单的属性
  menu: {
    iconDefault: 'iconfont icon-caidan',
    props: {
      label: 'name',
      path: 'path',
      icon: 'source',
      children: 'children'
    }
  },
  // 授权地址
  authUrl: 'http://localhost/cnfic-auth/oauth/render',
  // 报表设计器地址(cloud端口为8108,boot端口为80)
  reportUrl: 'http://localhost:8108/ureport',
}
